export var ValidatorConstants;
(function (ValidatorConstants) {
    ValidatorConstants["REQUIRED"] = "REQUIRED";
    ValidatorConstants["LENGTH"] = "LENGTH";
    ValidatorConstants["LENGTH_MIN"] = "LENGTH_MIN";
    ValidatorConstants["LENGTH_MAX"] = "LENGTH_MAX";
})(ValidatorConstants || (ValidatorConstants = {}));
